<?php
@$verificationCodeString = $_POST["codeString"];

$numData[1] = "";
$numData[2] = "";
$numData[3] = "";
$numData[4] = "";
$numData[5] = "";
$numData[6] = "";
$numData[7] = "";
$numData[8] = "";
$numData[9] = "";

define('WORD_WIDTH', 15);
define('WORD_HIGHT', 22);
define('OFFSET_X', 4);
define('OFFSET_Y', 5);
define('WORD_SPACING', 15);

if (!function_exists('getimagesizefromstring')) {
	function getimagesizefromstring($string_data) {
		$uri = 'data:image/png;base64,' . base64_encode($string_data);
		return getimagesize($uri);
	}
}

function getDataFromString($base64Data) {
	$rawData = base64_decode($base64Data);
	$res = imagecreatefromstring($rawData);
	$size = getimagesizefromstring($rawData);
	$data = array();
	for ($i = 0; $i < $size[1]; ++$i) {
		for ($j = 0; $j < $size[0]; ++$j) {
			$rgb = imagecolorat($res, $j, $i);
			$rgbarray = imagecolorsforindex($res, $rgb);
			if ($rgbarray['red'] == 249 && $rgbarray['green'] == 249 && $rgbarray['blue'] == 249) {
				$data[$i][$j] = 0;
			} else {
				$data[$i][$j] = 1;
			}
		}
	}
	return $data;
}
if ($verificationCodeString) {
	$verificationCode = getDataFromString($verificationCodeString);

// cutout 4 numbers
	$data = array("", "", "", "");
	for ($i = 0; $i < 4; ++$i) {
		$x = ($i * (WORD_WIDTH + WORD_SPACING)) + OFFSET_X;
		$y = OFFSET_Y;
		$lines = array();
		for ($h = $y; $h < (OFFSET_Y + WORD_HIGHT); ++$h) {
			$columns = array();
			for ($w = $x; $w < ($x + WORD_WIDTH); ++$w) {
				$columns[] = $verificationCode[$h][$w];
			}
			$lines[] = $columns;
		}
		$data[$i] = $lines;
	}

	foreach ($numData as $key => $value) {
		$elementPathArr[] = getDataFromString($value);
	}

// match numbers
	$code = "";
	foreach ($data as $key => $number) {
		for ($i = 0; $i < 9; $i++) {
			for ($y = 0; $y < WORD_HIGHT; ++$y) {
				for ($x = 0; $x < WORD_WIDTH; ++$x) {
					$t = $elementPathArr[$i][$y][$x];
					if ($t == 1) {
						if ($number[$y][$x] != $t) {
							break 2;
						} elseif ($y == 21) {
							break 3;
						}
					}
				}
			}
		}
		$i = $i == 9 ? 0 : $i + 1;
		$code .= $i;
	}
	echo $code;
}
?>